import './App.css';
import React, { Component } from 'react'

 class App extends Component {
  state={
    nom:"moha",
    age:30
  }
  afch=()=>{
    return <>
    {this.state.nom} {this.state.age}
    </>
  }
  render() {
    return (
      <div>
        <h2>{this.afch}</h2>
      </div>
    )
  }
}
export default App











